import HomeBody from "../components/HomeBody"

export default function Index() {
  return (
    <div>
      {/* Home Header*/}
      <div>
        <img src="/logo.png"/>
        <h1>Code Blue</h1>
        <p>It is a scientifically unsupported fact that YC students are stressed.</p>
        <p>Luckily, we're here to help.</p>
      </div>

      <style jsx>{`
        div { height: 90vh; }
        h1 { font-family: Raleway; font-size: 15vw; }
        p { font-family: Corsiva; font-size: 5vw; }        
      `}</style>

      <HomeBody />

    </div>
  );
}
